import{_ as a,c as t,a0 as r,o}from"./chunks/framework.DYq99Jlw.js";const f=JSON.parse('{"title":"","description":"","frontmatter":{},"headers":[],"relativePath":"2025/01/个人命名规范.md","filePath":"2025/01/个人命名规范.md"}'),p={name:"2025/01/个人命名规范.md"};function s(n,e,c,l,i,h){return o(),t("div",null,e[0]||(e[0]=[r('<h2 id="命名规范" tabindex="-1">命名规范 <a class="header-anchor" href="#命名规范" aria-label="Permalink to &quot;命名规范&quot;">​</a></h2><h3 id="sfc语法" tabindex="-1">SFC语法 <a class="header-anchor" href="#sfc语法" aria-label="Permalink to &quot;SFC语法&quot;">​</a></h3><p>script全部使用setup组合式。</p><h3 id="变量" tabindex="-1">变量 <a class="header-anchor" href="#变量" aria-label="Permalink to &quot;变量&quot;">​</a></h3><p>使用小驼峰命名，如果是布尔类型，则使用is开头的小驼峰。</p><p>Vue的响应式变量只使用ref，并且变量名带上Ref作为结尾标记，如<code>const isClickedRef = ref(false)</code>。</p><p>Vue的computed使用小驼峰+Computed结尾,如xxxComputed。</p><p>Vue在setup中的顶级函数，均使用function声明，不要使用箭头函数。</p><p>function内部、回调函数、需要省略this绑定的情况下，再使用箭头函数。</p><p>Vue文件的script、template、style顺序请使用script在最上面，然后是template，最后是style。</p><p>LeanCloud变量序列化使用toJSON()，不要通过get一个个取值。</p><h3 id="常量" tabindex="-1">常量 <a class="header-anchor" href="#常量" aria-label="Permalink to &quot;常量&quot;">​</a></h3><p>全部使用大写加下划线命名，如果是布尔类型，则用IS开头。</p><h3 id="函数" tabindex="-1">函数 <a class="header-anchor" href="#函数" aria-label="Permalink to &quot;函数&quot;">​</a></h3><p>全部使用on开头的驼峰命名，on后面紧跟操作，如onClickXxxxx、onChangeXxxxx、onAnalysisXxxxx，一般来说操作都是动词才对。最后的Xxxxx则是具体的业务，视情况填写即可。</p><p>函数的入参统统使用一个Object传入，如果是TS则协助声明类型，如果是JS则协助使用JSDoc声明类型。</p><p>函数的返回值一定是Promise，即使是空，也要返回<code>Promise.reject(0)</code>。</p><h3 id="css的class" tabindex="-1">CSS的class <a class="header-anchor" href="#css的class" aria-label="Permalink to &quot;CSS的class&quot;">​</a></h3><p>全部使用小写加横杠的方式。</p><h3 id="文件夹与文件命名" tabindex="-1">文件夹与文件命名 <a class="header-anchor" href="#文件夹与文件命名" aria-label="Permalink to &quot;文件夹与文件命名&quot;">​</a></h3><p>文件与文件夹均使用小写字母加横杠。</p><p>文件使用业务名称，如果存在子级则创建同名文件夹。</p><p>新建文件时候，如果有文件夹，不要使用index作为最后文件，使用与文件夹同名的文件名。如my/index.vue错误，my/my.vue正确。</p><h3 id="代码" tabindex="-1">代码 <a class="header-anchor" href="#代码" aria-label="Permalink to &quot;代码&quot;">​</a></h3><p>代码行结尾不要添加分号，除非有必要。</p><p>js代码都需要弃用@ts-check与jsdoc辅助类型检测。</p><p>待实现的需要使用 TODO xxx 格式做注释。</p><p>缩进统统使用2个空格。</p><h3 id="占位静态资源" tabindex="-1">占位静态资源 <a class="header-anchor" href="#占位静态资源" aria-label="Permalink to &quot;占位静态资源&quot;">​</a></h3><h4 id="图片" tabindex="-1">图片 <a class="header-anchor" href="#图片" aria-label="Permalink to &quot;图片&quot;">​</a></h4><p>城市: <a href="https://fuss10.elemecdn.com/8/27/f01c15bb73e1ef3793e64e6b7bbccjpeg.jpeg" target="_blank" rel="noreferrer">https://fuss10.elemecdn.com/8/27/f01c15bb73e1ef3793e64e6b7bbccjpeg.jpeg</a></p><p>风景: <a href="https://cube.elemecdn.com/6/94/4d3ea53c084bad6931a56d5158a48jpeg.jpeg" target="_blank" rel="noreferrer">https://cube.elemecdn.com/6/94/4d3ea53c084bad6931a56d5158a48jpeg.jpeg</a></p><p>动物: <a href="https://fuss10.elemecdn.com/3/28/bbf893f792f03a54408b3b7a7ebf0jpeg.jpeg" target="_blank" rel="noreferrer">https://fuss10.elemecdn.com/3/28/bbf893f792f03a54408b3b7a7ebf0jpeg.jpeg</a></p><h4 id="视频" tabindex="-1">视频 <a class="header-anchor" href="#视频" aria-label="Permalink to &quot;视频&quot;">​</a></h4><p>大自然: <a href="http://vjs.zencdn.net/v/oceans.mp4" target="_blank" rel="noreferrer">http://vjs.zencdn.net/v/oceans.mp4</a></p><p>动画片: <a href="https://media.w3.org/2010/05/sintel/trailer.mp4" target="_blank" rel="noreferrer">https://media.w3.org/2010/05/sintel/trailer.mp4</a></p>',36)]))}const b=a(p,[["render",s]]);export{f as __pageData,b as default};
